import React, {} from 'react'

function Palette(props) {

  let paletteMethod = 2

  switch(paletteMethod) {
    case 2:
      return (
        <div className="palette-container">
          <div className="color-pan" style={{ backgroundColor: 'hsl(props.mainColor)' }}></div>
          <div className="color-pan"></div>
        </div>
      )
    case 3:
      return (
        <div className="palette-container">
          <div className="color-pan"></div>
          <div className="color-pan"></div>
          <div className="color-pan"></div>
        </div>
      )
    case 4:
      return (
        <div className="palette-container">
          <div className="color-pan"></div>
          <div className="color-pan"></div>
          <div className="color-pan"></div>
          <div className="color-pan"></div>
        </div>
      )
    case 5:
      return (
        <div className="palette-container">
          <div className="color-pan"></div>
          <div className="color-pan"></div>
          <div className="color-pan"></div>
          <div className="color-pan"></div>
          <div className="color-pan"></div>
        </div>
      )
    default:
      return (
        <div className="palette-container">
          <div></div>
          <div></div>
          <div></div>
        </div>
      )
    }
}

export default Palette;
